import React from "react";
import {AppBar, Toolbar, Typography, Button} from "@mui/material"

function Nav(){
    return(
        <div>
            <AppBar>
            <Toolbar>
                <Typography variant = "h6" component = "div" sx = {{flexGrow : 1}}>
                    my app
                </Typography>
                <Button color = "inherit">로그인</Button>
                <Button color = "inherit">회원가입</Button>
                </Toolbar>
            </AppBar>  
            <div>{/*내용*/ }</div>
        </div>
    );
}

export default Nav;
